import React, { Component } from 'react'

export default class Tryglasses extends Component {
  render() {
    return (
      <div style ={{position: 'absolute', top: '300px', left: '0', width: '100%'}}
      >
          <div className='row'>
              <div className='col-lg-6'>
                  <img src="./glassesImage/model.jpg" alt="..." />
              </div>
              <div className='col-lg-6' style={{position: 'relative'}} >
              <img src="./glassesImage/model.jpg" alt="..." />
              <div className='glass_img' style={{position: 'absolute', top: '32%', left: '25%', width: '238px',height: '65px', opacity: '0.9',display: 'block'}}>
                  <img src="./glassesImage/v1.png" alt="..." />
              </div>
              </div>
          </div>



      </div>
    )
  }
}
